import React from 'react';
import PropTypes from 'prop-types';
import './DataCards.scss';

const DataCards = props => {
  const { cardData } = props;
  const { data, handler } = cardData;

  const cards =
    data &&
    data instanceof Array &&
    data.map(depart => {
      return (
        <div className="col col-12 col-lg-4 col-md-6 mb-3">
          <button
            className="btn h-100  w-100 p-3  border data-card  "
            onClick={() => handler}
          >
            <div className="card-title">{depart.title}</div>
            {depart.body}
          </button>
        </div>
      );
    });
  return <div className="row cards">{cards}</div>;
};

DataCards.propTypes = {
  data: PropTypes.object,
  cardData: PropTypes.object.isRequired
};

DataCards.defaultProps = {
  data: {}
};

export default DataCards;
